import React from 'react';
import "./Topbar";
import { Button,Nav,Navbar, NavbarBrand } from "react-bootstrap";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";


export default function topbar() {
  return (
    <div>
        <Navbar className="bg-secondary" expand='sm'>
        <div className="container">
          <NavbarBrand href='#'>
            Socialmedia App
          </NavbarBrand>
          <Navbar.Toggle aria-controls='ny-nav'/>
          <Navbar.Collapse id='my-nav'>
         <Nav className="fw-bold">
          <Nav.Link href='#'>Homepage</Nav.Link>
          <Nav.Link href='#'>Timeline</Nav.Link>
         </Nav>
         </Navbar.Collapse>
          </div>
          
          </Navbar>
        
        this is Topbar
        <Button className="btn btn-danger">Topbar</Button>
        
    </div>
    
  );
};
